import React, { Component } from "react";
import { ListItem, ListInfo } from "../style";

class List extends Component {
  render() {
    return (
      <ListItem>
        <img src="" className="pic" />
        <ListInfo>
          <h3> 1</h3>
          <p>1</p>
        </ListInfo>
      </ListItem>
    );
  }
}

export default List;
